import React from 'react';
import './style.css';
import Sidebar from '../../components/Sidebar';
import Card from '../../components/UI/Card';
import RecentPosts from './RecentPosts';


const sideImage= props=>{
    return(
        <div style={{height:`${sideImageHeight}px`}}>
            <img src={`https://1.bp.blogspot.com/-q2G-P44QbXs/V9_PE1fnC-I/AAAAAAAAD5A/5zt-KGj_SpUZSQwI6DA5ldLYQfC3LvG8wCLcB/s1600/5.jpg`} alt=""/>
        </div> 
    );
}
const ImageGallary = props=>{    
}

const Home = props=> {
    const gallaryheight=450;
    const gallaryStyle={
        height:gallaryheight+'px',
        overflow:'hidden'
    } 

   const sideImageHeight= gallaryheight/3;

    return(
        <div>
         <Card >
          <div className="gallaryPost" style={gallaryStyle}>          
            <section style={{width:'70%'}}>
              <div>  
                <img src={require('../../blogPostImages/girl.png')} alt=""/>
              </div> 
            </section>
  
            <section  className="sideImageWrapper" style={{width:'30%'}}>
                
                <div style={{height:`${sideImageHeight}px`}}>
                    <img src={`https://2.bp.blogspot.com/-ZOY5OAvnKj0/V9_M3_TVTLI/AAAAAAAAD40/UQl4rIoqgi42zaeq0yR_y1gnnchZFxupQCLcB/s1600/3-3.jpg`} alt=""/>
                </div> 
                <div style={{height:`${sideImageHeight}px`}}>
                    <img src={`https://1.bp.blogspot.com/-q2G-P44QbXs/V9_PE1fnC-I/AAAAAAAAD5A/5zt-KGj_SpUZSQwI6DA5ldLYQfC3LvG8wCLcB/s1600/5.jpg`} alt=""/>
                </div> 
            </section>
          </div>
                
         </Card>
            <section className="HomeContainer">
                <RecentPosts style={{width:'70%' }}/>
                <Sidebar/>
            </section>
            
        </div>
    );
}

export default Home;
